import React from 'react';
import './OnBoarding.css'; // Make sure to create this CSS file

function OnBoarding() {
  return (
    <div className="setup-container">
      <div className="top-rectangle"></div>

      <div className="main-content">
        <img src="path_to_your_image.jpg" alt="Descriptive Alt Text" className="center-image"/>
        <p className="text-paragraph">Your first paragraph of text goes here.</p>
        <p className="text-paragraph">Your second paragraph of text goes here.</p>
      </div>

      <img src="path_to_your_small_image.jpg" alt="Descriptive Alt Text" className="bottom-image"/>
    </div>
  );
}

export default OnBoarding;
